import React from "react";
import Button from 'react-bootstrap/Button';
import "./Register.css";

function Register() {
  return (
    <>
      <form className="reg-form">
        <input placeholder="name" className="reg-input" type="text" />
        <input placeholder="username" className="reg-input" type="text" />
        <input placeholder="email" className="reg-input" type="email" />
        <input placeholder="password" className="reg-input" type="password" />
        <Button className="reg-btn" variant="success"> Register ..</Button>
        <Button className="reg-btn" variant=""> Register ..</Button>
      </form>
    </>
  );
}

export default Register;
